import React, {useState} from 'react'
import "./button.css"


const Button = ()=>{


  window.addEventListener("onkeydown", (e)=>{

    console.log(e)
    if (e.code === 13){
      console.log(e.code)
    }
  })
  

  const [counter, setCounter] = useState(0);
  
  return (<button className="btn" type ="button" onMouseOver= {() => setCounter(counter + 1)}>Register now! {counter} hovers </button>
  )
};
export default Button;
